  true,\n\t\"url\": null,\n\t\"notes\": \"The River Carbon Flux data set represents
  estimates for the riverine export of carbon and of sediments. This data set includes
  the amounts of carbon and of sediments that are discharged to the oceans by rivers
  for each coastal grid point which receives river inputs. This data set contains
  three compressed (*.zip) files: the original data at 2.5 x 2.0 degrees, and global
  maps at spatial resolutions of 0.5 and 1.0 degree which the ISLSCP II staff has
  created from the original data. \",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
